import React from 'react';
import headerLogo from '../images/logo.svg';
import { Link, useHistory } from 'react-router-dom';

function Header({loggedIn, email}) {

  const history = useHistory();
/*
  function signOut(){
    localStorage.removeItem('token');
    history.push('/login');
  }*/
  function signOut(){
    console.log('ok')
  }


  return (
    <header className="header">
        <a href="#">
          <img src={headerLogo} alt="Логотип" className="header__logo" />
        </a>

        <ul className="header__navBar">
          <li className="header__nav">{email}</li>
          <li className="header__nav">{loggedIn? <Link to="/login" className="header__nav-link" onClick={signOut}>Выйти</Link> : <Link to="/register" className="header__nav-link">Регистрация</Link>}</li>
        </ul>
    </header>
  );
}

export default Header;


